import { Movie } from "./Movies";

function Movies(props) {
    const { movies = [] } = props;

    return (
        <div className="movies">
            {movies.length ? (
                movies.map((movie) => <Movie key={movie.imdID} {...movie} />)
            ) : (
                <h4>Not found</h4>
            )}
        </div>
    );
}
export { Movies };
